@Slf4j
@RestController
@RequestMapping("/user")
public class UserController {
    List<User> users = new ArrayList<>();
    IdGenerator idGenerator = new IdGenerator();

    @PostMapping
    public void addUser(@RequestBody User user) {
        log.info("POST /user");
        checkBody(user);
        user.setId(idGenerator.generateId());
        users.add(user);
    }

    @PutMapping("/{id}")
    public void updateUser(@PathVariable int id, @RequestBody User user) {
        log.info("PUT /user/" + id);
        checkBody(user);
        users.set(id, user);
    }

    @GetMapping
    public List<User> getAllUsers() {
        log.info("GET /user");
        return users;
    }


    private static class ValidationException extends RuntimeException {
        public ValidationException(String message) {
            super(message);
        }
    }

    private void checkBody(@RequestBody User user) throws ValidationException {
        if (user.getEmail().isEmpty() || !user.getEmail().contains("@")) {
            log.error("Некорректный адрес электронной почты");
            throw new ValidationException("Некорректный адрес электронной почты");
        } else if (user.getLogin().isEmpty() || user.getLogin().contains(" ")) {
            log.error("Некорректный логин");
            throw new ValidationException("Некорректный логин");
        } else if (user.getName() == null || user.getName().isEmpty()) {
            user.setName(user.getLogin());
        } else if (user.getBirthday() != null && user.getBirthday().isAfter(LocalDate.now())) {
            log.error("Дата рождения не может быть в будущем");
            throw new ValidationException("Дата рождения не может быть в будущем");
        }
    }
}

import ru.yandex.practicum.filmorate.IdGenerator;
import ru.yandex.practicum.filmorate.model.Film;
import lombok.extern.slf4j.Slf4j;
import org.springframework.web.bind.annotation.*;

import java.time.LocalDate;
import java.util.ArrayList;
import java.util.List;

@Slf4j
@RestController
@RequestMapping("/film")
public class FilmController {
    List<Film> films = new ArrayList<>();
    IdGenerator idGenerator = new IdGenerator();

    @PostMapping
    public void addFilm(@RequestBody Film film) throws ValidationException {
        log.info("POST /film");
        checkBody(film);
        film.setId(idGenerator.generateId());
        films.add(film);
    }

    @PutMapping("/{id}")
    public void updateFilm(@PathVariable int id, @RequestBody Film film) throws ValidationException {
        log.info("PUT /film/" + id);
        checkBody(film);
        films.set(id, film);
    }

    @GetMapping
    public List<Film> getAllFilms() {
        log.info("GET /film");
        return films;
    }


    private static class ValidationException extends RuntimeException {
        public ValidationException(String message) {
            super(message);
        }
    }

    private void checkBody(@RequestBody Film film) throws ValidationException {
        if (film.getName().isEmpty()) {
            log.error("Название фильма не может быть пустым");
            throw new ValidationException("Название фильма не может быть пустым");
        } else if (film.getDescription().length() > 200) {
            log.error("Описание фильма не может превышать 200 символов");
            throw new ValidationException("Описание фильма не может превышать 200 символов");
        } else if (film.getReleaseDate().isBefore(LocalDate.of(1895, 12, 28))) {
            log.error("Дата релиза не может быть раньше 28 декабря 1895 года");
            throw new ValidationException("Дата релиза не может быть раньше 28 декабря 1895 года");
        } else if (film.getDuration() <= 0) {
            log.error("Продолжительность фильма должна быть положительной");
            throw new ValidationException("Продолжительность фильма должна быть положительной");
        }
    }
}

package com.mod.common.datagen;

